import Modal from 'react-modal'

Modal.setAppElement('#root')

const CustomModal = ({ open }) => {

    return (
        <Modal isOpen={open}>
            <h4>MODAL DE TESTE</h4>
        </Modal>
    )
}

export default CustomModal
